CHAPITRE  44 SECTION  IX 
BOIS, CHARBON DE BOIS ET OUVRAGES EN BOIS; LIEGE ET  
OUVRAGES EN  LIEGE;  OUVRAGES  DE SPARTERIE  OU DE VANNERIE  
BOIS,  CHARBON  DE BOIS  ET OUVRAGES  EN BOIS  
Notes . 
1.- Le présent  Chapitre  ne comprend pas  : 
a)les bois en copeaux, en éclats, concassés, moulus ou pulvérisés, des espèces utilisées
principalement en parfumerie, en médecine ou à usages insecticides, parasiticides ou
similaires  (n° 12.11);
b)les bambous ou autres matières de nature  ligneuse  des espèces utilisées principalement
en vannerie ou en sparterie, bruts, même fendus, sciés longitudinalement ou coupés de
longueur  (n° 14.01)  ;
c)les bois en copeaux, en éclats, moulus ou pulvérisés des espèces utilisées principalement
pour la teintur e ou le tannage  (n° 14.04) ;
d)les charbons  activés  (n° 38.02)  ;
e)les articles  du n° 42.02  ;
f)les ouvrages  du Chapitre  46 ;
g)les chaussures  et leurs  parties,  du Chapitre  64 ;
h)les articles du Chapitre 66 (les parapluies, les cannes et leurs parties, par exemple);
ij) les ouvrages  du n° 68.08  ; 
k)la bijouterie de  fantaisie  du n° 71.17 ;
l)les articles  de la Section  XVI ou de la Section  XVII (pièces  mécaniques,  boîtiers,
enveloppes,  cabinets  pour machines  et appareils  et pièces  de charronnage,  par exemple);

par exemple);
m) Les articles de  la Section XVIII (les cages et  cabinets d'appareils d'horlogerie et les
instruments  de musique  et leurs  parties,  par exemple);
n)les parties  d'armes  (n° 93.05);
o)les articles du Chapitre 94 (meubles, luminaires et appareils d'éclairage, cons tructions
préfabriquées,  par exemple);
p)les articles  du Chapitre  95 (jouets, jeux,  engins  sportifs, par  exemple);
